description:
Create your own 3D parallax Live Wallpaper.

Simply take a photo with Google Camera's Lens Blur feature (Android 4.4 only) and share it to this app or pick images from Google Plus.

Depth Photo Live Wallpaper also includes a selection of great wallpapers to get you started.

To start, long-press on an open area on your homescreen, select Wallpapers, Live Wallpaper and then pick Depth Photo from the list.

Gyroscope support varies with device.

